(1043, 100092, 4, '33.00', '{\"id\":4,\"name\":\"Bitter Orange Marinade\",\"description\":\"<p id=\\\"mntl-sc-block_1-0\\\" class=\\\"comp mntl-sc-block mntl-sc-block-html\\\" style=\\\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; padding: 0px; letter-spacing: -0.1px; counter-reset: section 0; font-family: &quot;Work Sans&quot;, Arial, sans-serif; font-size: 17px; white-space: normal; background-color: rgb(255, 255, 255);\\\">Bitter oranges are often used in Caribbean&nbsp;<\\/p><p><br\\/><\\/p>\",\"price\":33,\"stars\":4,\"people\":5,\"selected_people\":3,\"img\":\"images\\/f38f470cc1972c270320c222c3aca9fb.jpg\",\"location\":\"Killarney Provincial Park\",\"created_at\":\"2021-11-17 10:18:46\",\"updated_at\":\"2022-01-01 08:55:05\",\"type_id\":3}', 2, '10.00', '2022-09-25 15:09:46', '2022-09-25 15:09:46'),
(1044, 100093, 9, '8.00', '{\"id\":9,\"name\":\"Biriani\",\"description\":\"<p style=\\\"box-sizing: inherit; padding: 0px; margin-top: 16px; margin-bottom: 16px; color: rgb(61, 61, 61); font-family: Raleway, sans-serif; font-size: 18px; white-space: normal;\\\">Chicken marinated in a spiced yoghurt is placed in a large pot, then layered with fried onions (cheeky easy sub below!), fresh coriander\\/cilantro, then par boiled lightly spiced rice.<\\/p><p style=\\\"box-sizing: inherit; padding: 0px; margin-top: 16px; margin-bottom: 16px; color: rgb(61, 61, 61); font-family: Raleway, sans-serif; font-size: 18px; white-space: normal;\\\">The crowning glory is to finish it off with a drizzle of saffron infused water to give it the signature patches of bright yellow rice, as well as ghee (or melted butter) for buttery richness.<\\/p><p style=\\\"box-sizing: inherit; padding: 0px; margin-top: 16px; margin-bottom: 16px; color: rgb(61, 61, 61); font-family: Raleway, sans-serif; font-size: 18px; white-space: normal;\\\">The pot is then covered and cooked over a low heat for about 25 minutes during which time the rice absorbs the aromas and flavours of the curry underneath, whilst still being beautifully fluffy.<\\/p><p><br\\/><\\/p>\",\"price\":8,\"stars\":4,\"people\":3,\"selected_people\":3,\"img\":\"images\\/0f61cb5dd19d38a11e5a9133333eca07.jpeg\",\"location\":\"BD\",\"created_at\":\"2021-12-27 06:27:38\",\"updated_at\":\"2022-01-01 08:57:16\",\"type_id\":3}', 2, '10.00', '2022-09-26 15:10:48', '2022-09-26 15:10:48'),
