(1266, 100257, 10, '12.00', '{\"id\":10,\"name\":\"Chicken biriani\",\"description\":\"<p><span style=\\\"color: rgb(17, 17, 17); font-family: -apple-system, &quot;system-ui&quot;, &quot;Segoe UI&quot;, Roboto, Oxygen-Sans, Ubuntu, Cantarell, &quot;Fira Sans&quot;, &quot;Droid Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, &quot;\\u30d2\\u30e9\\u30ae\\u30ce\\u89d2\\u30b4 Pro W3&quot;, &quot;Hiragino Kaku Gothic Pro&quot;, \\u30e1\\u30a4\\u30ea\\u30aa, Meiryo, &quot;\\uff2d\\uff33 \\uff30\\u30b4\\u30b7\\u30c3\\u30af&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 14px; background-color: rgb(255, 255, 255);\\\">Chicken Biryani Served in a Bowl Close Up Photo. Indian Food, Indian Style Rice and Chicken. #Biryani #ChickenBiryani #IndianFood #StockPhoto<\\/span><\\/p>\",\"price\":12,\"stars\":4,\"people\":3,\"selected_people\":3,\"img\":\"images\\/9447a79793a4b7f832d981f975c0abc4.jpeg\",\"location\":\"china\",\"created_at\":\"2021-12-27 06:29:47\",\"updated_at\":\"2022-01-01 08:56:33\",\"type_id\":2}', 4, '10.00', '2023-03-08 06:55:13', '2023-03-08 06:55:13'),
(1267, 100258, 1, '12.00', '{\"id\":1,\"name\":\"Nutritious fruit meal in china\",\"description\":\"<p style=\\\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 17px; line-height: inherit; font-family: Karla, Helvetica, Arial, Verdana, sans-serif; vertical-align: baseline; color: rgb(38, 38, 38); white-space: normal; background-color: rgb(255, 255, 255);\\\">This&nbsp;five red bases, two are dedicated to salami (fennel and regular), and there&#39;s a classic capricciosa or beef carpaccio. Blanco options include a mushroom, and a four-cheese extravaganza featuring great lobes of a tangy fior di latte they make in house every day (more on this later). Classic, precise, good.<\\/p><p style=\\\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 17px; line-height: inherit; font-family: Karla, Helvetica, Arial, Verdana, sans-serif; vertical-align: baseline; color: rgb(38, 38, 38); white-space: normal; background-color: rgb(255, 255, 255);\\\">I think it&#39;s still better to think of this venue not as a pizzeria, but as Pizza, by Di Stasio.<\\/p><p style=\\\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 17px; line-height: inherit; font-family: Karla, Helvetica, Arial, Verdana, sans-serif; vertical-align: baseline; color: rgb(38, 38, 38); white-space: normal; background-color: rgb(255, 255, 255);\\\">Rinaldo Di Stasio and Mallory Wall&#39;s empire, including the original restaurant and bar in St Kilda, Citta and now Carlton, is a designer label for dining.<\\/p><p><br\\/><\\/p>\",\"price\":12,\"stars\":4,\"people\":5,\"selected_people\":5,\"img\":\"images\\/ea9367e8a16f1d3e41d4a3ae9af2baff.png\",\"location\":\"Canada, British Columbia\",\"created_at\":\"2021-11-17 10:09:08\",\"updated_at\":\"2022-05-16 11:48:53\",\"type_id\":2}', 3, '10.00', '2023-03-08 06:55:48', '2023-03-08 06:55:48'),
