(1367, 100338, 11, '12.00', '{\"id\":11,\"name\":\"Hilsha fish\",\"description\":\"<p><span style=\\\"color: rgb(17, 17, 17); font-family: -apple-system, &quot;system-ui&quot;, &quot;Segoe UI&quot;, Roboto, Oxygen-Sans, Ubuntu, Cantarell, &quot;Fira Sans&quot;, &quot;Droid Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, &quot;\\u30d2\\u30e9\\u30ae\\u30ce\\u89d2\\u30b4 Pro W3&quot;, &quot;Hiragino Kaku Gothic Pro&quot;, \\u30e1\\u30a4\\u30ea\\u30aa, Meiryo, &quot;\\uff2d\\uff33 \\uff30\\u30b4\\u30b7\\u30c3\\u30af&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 14px; background-color: rgb(255, 255, 255);\\\">Ilish Mach aka Hilsa fish is in the season and needless to say, I cooked it a few times this year as well. This year, however, I have used Ilish mach to make simple delicacies mostly. Ilish Beguner Jhol is probably the simplest of the lot, well, after Ilish Mach Bhaja.<\\/span><\\/p><p><span style=\\\"color: rgb(17, 17, 17); font-family: -apple-system, &quot;system-ui&quot;, &quot;Segoe UI&quot;, Roboto, Oxygen-Sans, Ubuntu, Cantarell, &quot;Fira Sans&quot;, &quot;Droid Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, &quot;\\u30d2\\u30e9\\u30ae\\u30ce\\u89d2\\u30b4 Pro W3&quot;, &quot;Hiragino Kaku Gothic Pro&quot;, \\u30e1\\u30a4\\u30ea\\u30aa, Meiryo, &quot;\\uff2d\\uff33 \\uff30\\u30b4\\u30b7\\u30c3\\u30af&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 14px; background-color: rgb(255, 255, 255);\\\"><span style=\\\"color: rgb(17, 17, 17); font-family: -apple-system, &quot;system-ui&quot;, &quot;Segoe UI&quot;, Roboto, Oxygen-Sans, Ubuntu, Cantarell, &quot;Fira Sans&quot;, &quot;Droid Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, &quot;\\u30d2\\u30e9\\u30ae\\u30ce\\u89d2\\u30b4 Pro W3&quot;, &quot;Hiragino Kaku Gothic Pro&quot;, \\u30e1\\u30a4\\u30ea\\u30aa, Meiryo, &quot;\\uff2d\\uff33 \\uff30\\u30